function navToggle(){var e=document.getElementById("nav-toggle"),s=document.getElementById("nav-list");"nav-toggle-button close"==e.getAttribute("class")?(e.classList.remove("close"),s.classList.remove("close"),e.classList.add("open"),s.classList.add("open")):(e.classList.remove("open"),s.classList.remove("open"),e.classList.add("close"),s.classList.add("close"))}document.getElementById("nav-toggle").onclick=navToggle;